pragma solidity ^0.6.0;
import '@openzeppelin/contracts/math/SafeMath.sol';
import'./libraries/SafePercentage.sol';

contract BorrowingInfo{
    using SafeMath for uint;
    using SafeMath for uint8;
    using SafePercentage for uint;
    uint ethDaiExchangeRateCurrent =200;
    
    
    
    function calculateCollateral(uint _loanInDai) public view
    returns(uint)
    
    {
        uint _loan = _toEthFromDai(_loanInDai);
        uint _collateral = _loan.percentMul(150);
        return _collateral;
        
        
        
    }
    
    
    function calculateLoan(uint _collateralInEth) public view 
    returns(uint)
    {
      
      uint _collateral=_toDaiFromEth(_collateralInEth);
      uint _loan =_collateral.percentDiv(150);
      return _loan;
    }
    
    
    
    function _toDaiFromEth(uint _eth) private view
    returns(uint)
    {
        uint _priceInDai= _eth.mul(ethDaiExchangeRateCurrent);
        return _priceInDai;
    }
    
    function _toEthFromDai(uint _dai) private view
    returns(uint)
    {
        uint _priceInEth =_dai.div(ethDaiExchangeRateCurrent);
        return _priceInEth;
    }
    
    
    
  

    
}
